import React from 'react'
import {StyleSheet, Image, View, Text} from 'react-native'

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.itemContainer}>
        <View style={styles.leftContainer}>
          <Image
            style={{width: 100, height: 100}}
            source={{
              uri: 'https://reactnative.dev/img/tiny_logo.png'
            }}
          />
        </View>
        <View style={styles.rightContainer}>
          <Text numberOfLines={3}>
            When the image is resized, the corners of the size specified by
            capInsets will stay a fixed size, but the center content and borders
            of the image will be stretched. This is useful for creating
            resizable rounded buttons, shadows, and other resizable assets. More
            info in the official Apple documentation.
          </Text>
          <Text>ReactNews</Text>
        </View>
      </View>
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center'
  },
  itemContainer: {
    height: 100,
    width: '100%',
    borderColor: 'gray',
    borderWidth: 1,
    flexDirection: 'row'
  },
  leftContainer: {
    width: 100
  },
  rightContainer: {
    flex: 1,
    flexDirection: 'column',
    padding: 10
  },
  text: {
    fontSize: 16
  }
})
